// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC1155/IERC1155.sol";


contract ZeOTC {











  enum Status_zeSwap {
    Open, /**0. at zeSwap creation */
    Active, /**1. at least 1 demander */
    Fullfilled, /**2. swapped */
    Ended, /**3. expired */
    Canceled /**4. supplier only */
  }

  enum Status_Offer {
    Initial, /**0. at offer creation */
    Pending_confirmations, /**1. 1 offer received */
    Accepted, /**2. received offer accepted */
    Rejected  /**3. received offer rejected */
  }


  event Offer_Status_Token_Approvement(bytes32 indexed zSwap_id, bytes32 indexed offer_id, address sender, Product[] tokens);
  event Remove_Product(bytes32 indexed zSwap_id, bytes32 indexed offer_id, address sender, Product product);

  uint256 private nonce = 0;

  struct ZeSwap{
    bytes32 id;
    address supplier;
    address demander;
    uint256 expiration;
    bytes32[] offers;
    bool visibility;
    bool allow_counter_offer;
    Status_zeSwap status;
    uint256 created;
  }

  struct Offer{ 
    bytes32 id;
    address creator;
    Status_Offer status;
    bytes32[] product_A_ids;
    bytes32[] product_B_ids;
    uint256 created;
  }

  mapping(bytes32=>Offer) offer_map;
  mapping(address=>bytes32[]) my_offers;

  struct Product{
    bytes32 id;
    uint256 IERC; 
    uint256 token_id;
    address token; 
    uint256 amount; 
    uint256 created;
  }


  bytes32[] zSwap_id_list;
  mapping(bytes32 => ZeSwap) private zeSwap_map;
  mapping(bytes32 => ZeSwap) private zeSwap_reset_map;
  mapping(address => bytes32[]) private my_zeSwaps;

mapping(bytes32 => Product) private product_map;

IERC20 ZeVoid;
uint256 zeFee_in_stable = 0;
address zeOwner;


constructor(address zevoid_token_addr) {
  zeOwner = msg.sender;
  ZeVoid = IERC20(zevoid_token_addr);
}

function get_nonce() private returns(uint256) {
  return nonce++;
}

  function get_id(
    address tokenA, uint256 amount 
    ) private returns (bytes32) {
    return keccak256(abi.encode(
      msg.sender, tokenA, amount, address(this), block.number, block.timestamp, get_nonce()
    ));
  }



  function create_zeSwap(
      Product[] memory productAs, 
      Product[] memory productBs, 
      //
      uint256 expiration_in_UTC,
      address demander
    ) 
    external payable 
    not_0x0_and_0(productAs) 
    not_0x0_and_0(productBs) 
    {
    //
    is_approved(msg.sender, productAs); //users assets
    //
    bytes32 id = get_id(productAs[0].token, productAs[0].amount);
    //
    ZeSwap memory zeSwap = ZeSwap({
      id: id,
      supplier: msg.sender,
      demander: demander != address(0) ? demander : address(0),
      status: Status_zeSwap.Open,
      expiration: expiration_in_UTC,

      offers: create_offer(productAs, productBs),

      allow_counter_offer: false,
      visibility: demander != address(0) ? false : true,
      created: block.timestamp
    });
    //
    zSwap_id_list.push(id);
    zeSwap_map[id] = zeSwap;
    zeSwap_reset_map[id] = zeSwap;
    my_zeSwaps[msg.sender].push(id);    
    //    

    //events
    for(uint256 i=0; i < zeSwap.offers.length; i++){
      set_offer_status_token_approvement(id, zeSwap.offers[i], productAs);
    }
  }



  function add_counter_offer_userB(
    bytes32 zSwap_id,
    Product[] memory productAs, 
    Product[] memory productBs
    ) 
    public 
    swap_parties_only(zSwap_id)
    {
      ZeSwap memory zSwap = get_zeSwap(zSwap_id);
      if(zSwap.allow_counter_offer == false) revert('counter offer not allowed.');

      for(uint256 i=0; i<productAs.length; i++){
        if(ze_balanceOf(zSwap.supplier, productAs[i]) < productAs[i].amount)revert('Supplier has not enough tokens');
      }

      is_approved(msg.sender, productBs);
      //
      bytes32[] memory ids = create_offer(
        productAs, 
        productBs
      );
      //
      for(uint256 i=0; i<ids.length; i++){
        zeSwap_map[zSwap_id].offers.push(ids[i]);
        //events
        if(zSwap.demander==msg.sender)set_offer_status_token_approvement(zSwap_id, ids[i], productBs);
      }
  }



  function add_offer_userA(
    bytes32 zSwap_id, 
    Product[] memory productAs, 
    Product[] memory productBs
    ) 
    public 
    only_zSwap_creator(zSwap_id)
    {
    is_approved(msg.sender, productAs); 
    //
    bytes32[] memory ids = create_offer(productAs, productBs);
    //
    for(uint256 i=0; i<ids.length; i++){
      zeSwap_map[zSwap_id].offers.push(ids[i]);
      //
      //events
      if(zeSwap_map[zSwap_id].supplier==msg.sender)set_offer_status_token_approvement(zSwap_id, ids[i], productAs);
    }
  }  



  function create_offer(Product[] memory productAs, Product[] memory productBs) private 
    not_0x0_and_0(productAs) not_0x0_and_0(productBs)
    returns(bytes32[] memory)
    {
    //
    bytes32 id = get_id(productAs[0].token, productAs[0].amount);
    //
    Offer memory offer = Offer({    
      id: id,
      creator: msg.sender,
      status: Status_Offer.Initial,
      //multi assets
      product_A_ids: create_product(productAs),
      product_B_ids: create_product(productBs),
      created: block.timestamp
    });
    //
    offer_map[id] = offer;
    my_offers[msg.sender].push(id);    
    //    
    bytes32[] memory ids = new bytes32[](1);
    ids[0] = id;

    return ids;
  }



  function create_product(Product[] memory products) private returns(bytes32[] memory) {

    bytes32[] memory p_ids = new bytes32[](products.length);

    for(uint256 i=0; i<products.length; i++){

      isContract(products[i].token);
      IERC_allowed(products[i].IERC);

      bytes32 id = get_id(products[i].token, products[i].amount);

      Product memory p = Product({
        id: id,
        token_id: products[i].token_id,
        IERC: products[i].IERC,
        token: products[i].token,
        amount: products[i].amount,
        created: block.timestamp
      });
      product_map[id] = p;
      p_ids[i] = id;
    }
    return p_ids;
  }



function accept(bytes32 zSwap_id) external{
  set_demander(zSwap_id, msg.sender);
  swap(zSwap_id);
}



function is_0x_address(address addr) private pure returns(bool) {
  if(addr == address(0))return true;
  return false; 
}


function can_swap(ZeSwap memory zSwap) private view returns(bool) {
  if(zSwap.status != Status_zeSwap.Open && zSwap.status != Status_zeSwap.Active)revert('cannot swap: already fullfiled');
  if(is_0x_address(zSwap.demander) == true || is_0x_address(zSwap.supplier) == true)revert('address(0) not allowed');
  if(block.timestamp > zSwap.expiration) revert('Expired!');
  return true;
}



  function swap(bytes32 zSwap_id) private {
    ZeSwap memory zSwap = get_zeSwap(zSwap_id);

    if(can_swap(zSwap)==false)revert('error: cannot swap');

    for(uint256 i=0; i < zSwap.offers.length; i++){
      Offer memory zOffer = get_offers(zSwap.offers[i]);

      for(uint256 f=0; f < zOffer.product_A_ids.length; f++){ //send to demander
        Product memory product = get_product(zOffer.product_A_ids[f]);

        if(product.IERC == 20){
          if(allowed_ERC20(zSwap.supplier, product.token) < product.amount)revert('Supplier: Not enough tokens approved');
          IERC20(product.token).transferFrom(zSwap.supplier, zSwap.demander, product.amount);

        }else if(is_ERC721(product.token)==true){
          if(allowed_ERC721(product.token, product.token_id) == false)revert('Supplier: Not enough NFT(721) approved');
          IERC721(product.token).safeTransferFrom(zSwap.supplier, zSwap.demander, product.token_id);

        }else if(is_ERC1155(product.token)==true){
          if(allowed_ERC1155(product.token, zSwap.supplier) == false)revert('Supplier: Not enough NFT(1155) approved');
          IERC1155(product.token).safeTransferFrom(zSwap.supplier, zSwap.demander, product.token_id, product.amount, '');

        }else{
          revert('swap: fail! check the token typ');
        }
      }


      for(uint256 j=0; j < zOffer.product_B_ids.length; j++){ //send to supplier
        Product memory product = get_product(zOffer.product_B_ids[j]);

        if(product.IERC == 20){
          if(allowed_ERC20(zSwap.demander, product.token) < product.amount)revert('Demander: Not enough tokens approved');
          IERC20(product.token).transferFrom(zSwap.demander, zSwap.supplier, product.amount);

        }else if(is_ERC721(product.token)==true){
          if(allowed_ERC721(product.token, product.token_id) == false)revert('Demander: Not enough NFT(721) approved');
          IERC721(product.token).safeTransferFrom(zSwap.demander, zSwap.supplier, product.token_id);

        }else if(is_ERC1155(product.token)==true){

        }else{
          revert('swap: fail! check the token typ');
        }
      }
    }

    //update the list for performance reason
    for(uint256 k=0; k < zSwap_id_list.length; k++){
      if(zSwap_id_list[k] == zSwap_id){
        remove_id_from_array_list(k, zSwap_id_list);
        break;
      }
    }
    //set the swap status
    set_zSwap_status(zSwap_id, Status_zeSwap.Fullfilled);
  }



  function remove_id_from_array_list(uint256 index, bytes32[] storage array_list) internal {
    if (index >= array_list.length) revert('Out of bounds');

    for(uint256 i = index; i < (array_list.length - 1); i++) {
      array_list[i] = array_list[i+1];
    }
    array_list.pop();
  }


  function remove_product(
    bytes32 zSwap_id, 
    bytes32 offer_id, 
    bytes32 product_id
  ) public swap_parties_only(zSwap_id){

    Offer memory offer = get_offers(offer_id);
    address supplier = zeSwap_map[zSwap_id].supplier;
    address demander = zeSwap_map[zSwap_id].demander;

    if(supplier == msg.sender && offer.product_A_ids.length > 1){
      for(uint256 i=0; i < offer.product_A_ids.length; i++){   
        if(offer.product_B_ids[i] == product_id){
          remove_id_from_array_list(i, offer_map[offer_id].product_A_ids);
        }
      }
      //events
      emit Remove_Product(zSwap_id, offer_id, msg.sender, get_product(product_id));
    }

    if(demander == msg.sender && offer.product_B_ids.length > 1){
      for(uint256 i=0; i < offer.product_B_ids.length; i++){  
        if(offer.product_B_ids[i] == product_id){
          remove_id_from_array_list(i, offer_map[offer_id].product_B_ids);
        }
      }
      //events
      emit Remove_Product(zSwap_id, offer_id, msg.sender, get_product(product_id));
    }
  }



  function which_IERC(address token) internal view returns(uint256) {
    if(is_ERC721(token) == true){
      return 721;
    }else if(is_ERC1155(token) == true){
      return 1155;
    }else{
      return 20;
    }
  }




  function IERC_allowed(uint256 IERC) internal pure returns(uint256) {
    if(IERC == 721){
      return 721;
    }else if(IERC == 1155){
      return 1155;
    }else if(IERC == 20){
      return 20;
    }else{
      revert('ERC20, ERC721 and ERC1155 only!');
    }
  }


  function is_approved(address sender, Product[] memory products) private view returns(bool){    

    bool res = false;

    for(uint256 i=0; i<products.length; i++){  

      if(products[i].IERC==20){
        res = is_ERC20(sender, products[i].token, products[i].amount);

      }else if(res==false){
        if(which_IERC(products[i].token) == 721){
          if(allowed_ERC721(products[i].token, products[i].token_id) == false)revert('NFT ERC721 not approved.');
          res = true;

        }else if(which_IERC(products[i].token) == 1155){
          if(allowed_ERC1155(products[i].token, sender) == false)revert('NFT ERC1155 not approved.');
          res = true;
        }
      }

      if(res == false)revert('Not enough tokens approved');   
    }

    return true;
  }




  //SETTERS
  function set_product(
    bytes32 zSwap_id, 
    bytes32 offer_id, 
    Product[] memory new_products
    ) public {

    ZeSwap memory zSwap = zeSwap_map[zSwap_id];

    if(
      zSwap.supplier == msg.sender || 
      zSwap.demander == msg.sender || 
      zSwap.demander == address(0)
    ){

      IERC_allowed(new_products[0].IERC); 

      if(zSwap.demander == address(0) && msg.sender != zSwap.supplier){
        set_demander(zSwap_id, msg.sender); 
        zSwap = get_zeSwap(zSwap_id);
      }

      if(zSwap.demander == msg.sender && zSwap.allow_counter_offer==false)revert('Counter offer NOT allowed');      

      if(
        offer_map[offer_id].status == Status_Offer.Initial || 
        offer_map[offer_id].status == Status_Offer.Pending_confirmations
      ){

        if(msg.sender == zSwap.demander) is_approved(msg.sender, new_products);

        //set 
        product_map[new_products[0].id].token_id = new_products[0].token_id;
        product_map[new_products[0].id].IERC = new_products[0].IERC;
        product_map[new_products[0].id].token = new_products[0].token;
        product_map[new_products[0].id].amount = new_products[0].amount;

        //events
        Product[] memory products =  new Product[](1);
        products[0] = get_product(new_products[0].id);
        set_offer_status_token_approvement(zSwap_id, offer_id, products);

      }else{
        revert('Initial & Pending_confirmations status only');
      }
    }else{
      revert('Swap parties only!');
    }
  }




  function set_offer_status_token_approvement(
    bytes32 zSwap_id, bytes32 offer_id,
    Product[] memory products
  ) swap_parties_only(zSwap_id) private{

    is_approved(msg.sender, products);

    if(offer_map[offer_id].status == Status_Offer.Pending_confirmations || offer_map[offer_id].status == Status_Offer.Initial){
      offer_map[offer_id].status = Status_Offer.Pending_confirmations;
      //
      emit Offer_Status_Token_Approvement(zSwap_id, offer_id, msg.sender, products);
    }
  }



