  function allowed_ERC1155(address token_addr, address owner) public view returns(bool){
    return IERC1155(token_addr).isApprovedForAll(owner, address(this));
  }

  function ze_balanceOf(address owner, Product memory product) public view returns(uint256){
    if(product.IERC == 20){
      return IERC20(product.token).balanceOf(owner);

    }else if(product.IERC == 721){
      uint256 bal = IERC721(product.token).balanceOf(owner);
      if(IERC721(product.token).ownerOf(product.token_id) == owner) return bal;

    }else if(product.IERC == 1155){
      uint256 bal = IERC1155(product.token).balanceOf(owner, product.token_id);
      if(bal >= product.amount)return bal;
    }
    return 0;
  }

