  modifier swap_parties_only(bytes32 zSwap_id){
    ZeSwap memory zSwap = get_zeSwap(zSwap_id);
    //if none of both exists than revert()
    if(zSwap.supplier == msg.sender || 
      zSwap.demander == msg.sender){
        _;
      }else{
        revert('swap parties only!');
      }
  }


  modifier only_offer_creator(bytes32 offer_id){
    if(offer_map[offer_id].creator != msg.sender)revert('only_creator');
    _;
  }


  modifier only_zSwap_creator(bytes32 zSwap_id){
    if(zeSwap_map[zSwap_id].supplier != msg.sender)revert('only supplier');
    _;
  }


  function isContract(address token) private view returns(bool) {
    uint32 size;
    assembly {
      size := extcodesize(token)
    }
    if((size > 0) == false)revert('Not a contract!');
    return true;
  }

  modifier not_0x0_and_0(Product[] memory products){
    if(products.length == 0)revert('atleast 1 token address required');
    for(uint256 i=0; i < products.length; i++){
      if(products[i].token == address(0))revert('0x0 addressses not allowed!');
      if(products[i].amount == 0)revert('0 amount not allowed!');
    }
    _;
  }

  modifier not_0x00(address addr){
    if(addr == address(0))revert('0x0 addresss not allowed!');
    _;
  }


  modifier only_zeOwner(){
    if(zeOwner != msg.sender)revert('zeOwner only!');
    _;
  }



